import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const PackageContact = ({ heading }) => {
    return (
        <View>
            <Text style={styles.contactHeading}>{heading}</Text>
            <View style={styles.contact_Box}>
                <Text>Icons</Text>
                <Text>Contact</Text>
                <Text>Number</Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    contactHeading: {
        padding: '10px',
        color: "#102C56",
        fontWeight: '600',
        fontSize: '22px',
        lineHeight: "24px",
        letterSpacing: '2%'
    },
    contact_Box: {
        flex: 1,
        flexDirection: 'row',
        alignItems: 'center'
    }
})

export default PackageContact;
